import './styles.css';
import RickandMorty from '../RickandMorty.svg'
import CharCard from '../CharCard';

const Characters = ({listCharacters}) => {



  return (
    <>
      <h1>Characters <img src={RickandMorty} alt="logo" /></h1>
      <ul >

        {listCharacters.map(({name, image, id }) => (

          <CharCard name={name} image={image} key={id} />

        ))}

      </ul>

    </>
  )
}

export default Characters;
